  \"2016-06-07T07:41:54.411892\",\n\t\"name\": \"pedstrian-hybrid-beacon-phb-requests\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset contains the ranking and status
  of pedestrian hybrid beacons (PHBs) requests. rnrnDetailed information about the
  PHB evaluation process can be found here: http://austintexas.gov/page/pedestrian-hybrid-beaconsrnrn**Roadway
  Score**rnIncludes considerations such as the distance to the nearest signal or stop
  sign, number of lanes to cross, speed limit, and whether and what kind of median
  is present.rnrn**Pedestrian Score**rnIncludes considerations such as the pedestrian
  crash history and the number and type of pedestrian generators in the area.  Pedestrian
  generators include stores, restaurants, multifamily developments, bus stops, churches,
  schools, parks, etc.  Also considers whether there is a facility in the area whose
  primary clientele is a mobility impaired community.rnrn**Community Score**rnIncludes
  considerations such as whether the requested location is recommended for a PHB as
  part of an adopted neighborhood, corridor, or master plan; is part of a school route
  or within an Environmental Justice Area.\",\n\t\"license_title\": \"License Not
